import React, { useState, useEffect } from 'react';
import {
  Box,
  Paper,
  Typography,
  IconButton,
  List,
  ListItem,
  ListItemText,
  ListItemSecondary,
  Drawer,
  Divider,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import {
  Delete as DeleteIcon,
  Close as CloseIcon,
  NoteAdd as NoteAddIcon,
} from '@mui/icons-material';
import ReactMarkdown from 'react-markdown';

const Notebook = ({ open, onClose }) => {
  const [notes, setNotes] = useState(() => {
    const saved = localStorage.getItem('notebook');
    return saved ? JSON.parse(saved) : [];
  });
  const [selectedNote, setSelectedNote] = useState(null);

  useEffect(() => {
    const handleAddToNotebook = (event) => {
      const { content, timestamp, role } = event.detail;
      setNotes(prev => {
        const newNotes = [...prev, { content, timestamp, role, id: Date.now() }];
        localStorage.setItem('notebook', JSON.stringify(newNotes));
        return newNotes;
      });
    };

    window.addEventListener('addToNotebook', handleAddToNotebook);
    return () => window.removeEventListener('addToNotebook', handleAddToNotebook);
  }, []);

  const handleDeleteNote = (id) => {
    setNotes(prev => {
      const newNotes = prev.filter(note => note.id !== id);
      localStorage.setItem('notebook', JSON.stringify(newNotes));
      return newNotes;
    });
  };

  return (
    <Drawer
      anchor="right"
      open={open}
      onClose={onClose}
      PaperProps={{
        sx: {
          width: '400px',
          maxWidth: '100%',
          bgcolor: 'background.paper',
        }
      }}
    >
      <Box sx={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center',
        p: 2,
        borderBottom: 1,
        borderColor: 'divider'
      }}>
        <Typography variant="h6" component="div" sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <NoteAddIcon />
          Notebook
        </Typography>
        <IconButton onClick={onClose} size="small">
          <CloseIcon />
        </IconButton>
      </Box>

      <List sx={{ flexGrow: 1, overflow: 'auto' }}>
        {notes.map((note) => (
          <React.Fragment key={note.id}>
            <ListItem
              sx={{
                flexDirection: 'column',
                alignItems: 'flex-start',
                gap: 1,
                cursor: 'pointer',
                '&:hover': {
                  bgcolor: 'action.hover',
                }
              }}
            >
              <Box sx={{ 
                width: '100%',
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center'
              }}>
                <Typography variant="caption" color="text.secondary">
                  {new Date(note.timestamp).toLocaleString()}
                </Typography>
                <IconButton 
                  size="small" 
                  onClick={() => handleDeleteNote(note.id)}
                  sx={{ opacity: 0.7 }}
                >
                  <DeleteIcon fontSize="small" />
                </IconButton>
              </Box>
              <Box sx={{ 
                width: '100%',
                p: 1.5,
                borderRadius: 1,
                bgcolor: 'background.default',
                '& p': { m: 0 }
              }}>
                <ReactMarkdown>{note.content}</ReactMarkdown>
              </Box>
            </ListItem>
            <Divider />
          </React.Fragment>
        ))}
        {notes.length === 0 && (
          <Box sx={{ p: 3, textAlign: 'center' }}>
            <Typography color="text.secondary">
              No notes yet. Click on any message and select "Add to Notebook" to save it here.
            </Typography>
          </Box>
        )}
      </List>
    </Drawer>
  );
};

export default Notebook;
